import React, { Component } from "react";

class Stock extends Component {
  render() {
    return (
      <tbody>
        <tr>
          <td>{this.props.stock.name}</td>
          <td>{this.props.stock.date}</td>
          <td>
            <FontAwesomeIcon
              icon={["fas", "trash"]}
              onClick={() => this.props.deleteItem(this.props.item)}
            />
          </td>
        </tr>
      </tbody>
    );
  }
}

export default Stock;
